import example_workpack_detail from './WP/example_wp_detail';

import Images from './Images';
import tabs from './tabs';
import utils from './utils';
import config from './config';

export { 
    articles, 
    type_connection,

    approval_mrir,
    category_mrir,
    detail_mrir,

    example_workpack,
    example_workpack_detail,

    nowTheme, 
    Images, 
    tabs, 
    utils,
    config,
};
